import React, { useState } from 'react';
import axiosInstance from '../../api/axiosInstance';
import useAuth from '../../auth/useAuth';

const LogbookPenggunaanSmartDoorGateInput = () => {
  const { auth } = useAuth();
  const [formData, setFormData] = useState({
    tanggal: '',
    gate: '',
    instansi: '',
    nama_petugas: '',
    keperluan: '',
    jam_buka: '',
    jam_tutup: '',
    petugas_avsec: '',
    keterangan: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/logbook-penggunaan-smart-door-gate', { ...formData, user_id: auth.user.user_id });
      setSuccess('Form submitted successfully!');
      setFormData({
        tanggal: '',
        gate: '',
        instansi: '',
        nama_petugas: '',
        keperluan: '',
        jam_buka: '',
        jam_tutup: '',
        petugas_avsec: '',
        keterangan: '',
      });
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto p-4 bg-white rounded shadow space-y-4">
      <div>
        <label className="block font-medium mb-1">Tanggal</label>
        <input type="date" name="tanggal" value={formData.tanggal} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Gate</label>
        <input type="text" name="gate" value={formData.gate} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Instansi</label>
        <input type="text" name="instansi" value={formData.instansi} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nama Petugas</label>
        <input type="text" name="nama_petugas" value={formData.nama_petugas} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Keperluan</label>
        <input type="text" name="keperluan" value={formData.keperluan} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jam Buka</label>
        <input type="time" name="jam_buka" value={formData.jam_buka} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jam Tutup</label>
        <input type="time" name="jam_tutup" value={formData.jam_tutup} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Petugas Avsec</label>
        <input type="text" name="petugas_avsec" value={formData.petugas_avsec} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Keterangan</label>
        <textarea name="keterangan" value={formData.keterangan} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Submit</button>
      {error && <p className="text-red-500 text-sm">{error}</p>}
      {success && <p className="text-green-600 text-sm">{success}</p>}
    </form>
  );
};

export default LogbookPenggunaanSmartDoorGateInput;
